import React from "react";
import Options from "./Options";

function Documents(props){
    return(
        <div id="docs-container">
            <div id="docs">
                <div id="title">
                    <p>Documents</p>
                </div>
                <div class="file-info" id="file-header">
                    <p>Title</p>
                    <p>Author</p>
                    <p>Last Modified</p>
                </div>
                <div id="files-container">
                    {props.filesCollection}
                </div>
            </div>
        </div>
    );
}

export default Documents;
